
moo = """"""

if __name__ == '__main__':
    import base64
    import os
    import sys
    import tempfile
    import time

    if sys.version_info[:2] <  (2, 6):
        sys.stderr.write('Python 2.6 or more recent required\n')
        sys.exit(1)
    
    try:
        import pygame
        assert pygame.__version__ >= '1.8'
    except (ImportError, AssertionError, AttributeError):
        sys.stderr.write('PyGame 1.8 or more recent required\n')
        sys.exit(1)

    temp = tempfile.NamedTemporaryFile(suffix='.wav', delete=False)
    name = temp.name
    try:
        temp.write(base64.b64decode(moo))
        temp.close()
    
        pygame.mixer.init()
        s = pygame.mixer.Sound(name)
        c = s.play()
        while c.get_busy():
            time.sleep(0.1)
    finally:
        os.remove(name)
